import React from 'react';

class Islands extends React.Component {
  render() {
    const islands = this.props.islands.map(island => 
      <li key={island.id}> {island.name} </li>
      )
    return (
      <div>
        {islands}
      </div>
    )
  }
}

export default Islands;
